import axios from 'axios';
import React ,{useEffect,useState}from 'react'

const ListEmployees = () => {
    const [Employees, setEmployees] = useState([]);
    useEffect(() => {
        axios.get("http://127.0.0.1:8000/api/user")
        .then(function(res) {
            setEmployees(res.data);
        })
        .catch(function(error) {
            console.log(error)
        });
      }, []);

  return (
  <div>
  <button className='btn btn-primary text-center '> Add Employee</button>
{/* <!-- Button trigger modal --> */}
<button type="button" class="btn btn-primary" data-bs-toggle="modal" data-bs-target="#exampleModal">
  Launch demo modal
</button>

{/* <!-- Modal --> */}
<div class="modal fade" id="exampleModal" tabindex="-1" aria-labelledby="exampleModalLabel" aria-hidden="true">
  <div class="modal-dialog">
    <div class="modal-content">
      <div class="modal-header">
        <h1 class="modal-title fs-5" id="exampleModalLabel">Modal title</h1>
        <button type="button" class="btn-close" data-bs-dismiss="modal" aria-label="Close"></button>
      </div>
      <div class="modal-body">
        ...
      </div>
      <div class="modal-footer">
        <button type="button" class="btn btn-secondary" data-bs-dismiss="modal">Close</button>
        <button type="button" class="btn btn-primary">Save changes</button>
      </div>
    </div>
  </div>
</div>
    <div className='row gap-3 justify-content-center'>

        {Employees&&Employees.map(emp=>{
            return<div className='col-12 col-md-3'>

            <div className="card" style={{width: "18rem"}}>
          <div classNameName="card-header">
            Employee
          </div>
          <ul className="list-group list-group-flush">
            <li className="list-group-item"> Name: {emp.username}</li>
            <li className="list-group-item">Email:  {emp.email}</li>
            <li className="list-group-item">Role: {emp.role}</li>
            <li className="list-group-item"><button className='btn btn-success' >Edit</button></li>
          </ul>
        </div>

            </div>
        })}

            </div>

  </div>
  )
}

export default ListEmployees
